#include <iostream>
#include <string>
#include <bitset>
#include "fstream"
#include "istream"

using namespace std;

string hexToBin_2_dig(char &a, char &b)
{
    string binaryString = "";
    string str;
    str = a;
    str += b;
    for (char &it : str)
    {
        binaryString += bitset<4>(it).to_string();
    }
    return binaryString;
}
int main()
{

    string str = "";
    string rez;
    int cnt = 0;
    int i = str.length() / 2;

    for (int i = 0; i < str.length(); i += 2)
    {
        rez += hexToBin_2_dig(str[i], str[i + 1]);
    }
    cout << rez.length();
    // cout << rez;
    //  cout << cnt;
}

